import React from "react";
import { getPokemons } from "../../core/repositories/pokemons.repository";
import PokemonCard from "../../components/pokemon-card";
import useAsyncHook from "../../core/hooks/hooks";
import PokemonErrors from "../../components/pokemons-errors";
import PokemonLoading from "../../components/pokemons-loading";
import container from "../../components/container";

import { useAsync } from "react-async";

const Home = () => {
  const [pokemons, error, loading] = useAsyncHook();

  console.log("pokemons", pokemons);
  console.log("error", error);
  console.log("loading", loading);

  let listPokemon = [];

  if (pokemons.length > 0) {
    listPokemon = pokemons.map((pokemon) => <PokemonCard pokemon={pokemon} />);
  }

  return (
    <div>
      <nav class="navbar navbar-light bg-light">
        <div class="container-fluid">
          <form class="d-flex">
            <input
              class="form-control me-2"
              type="search"
              placeholder="Buscar Pokemon"
              aria-label="Search"
            ></input>
            <button class="btn btn-outline-success" type="submit">
              Buscar
            </button>
          </form>
        </div>
      </nav>

      <div class="container">
        <div class="row">
          <div class="col-md">
            <div id="products" class="row view-group">
              <div class="item col-xs-4 col-lg-4">
                {" "}
                {loading ? (
                  PokemonLoading
                ) : error ? (
                  <h1>PokemonErrors</h1>
                ) : (
                  listPokemon
                )}
              </div>
            </div>
          </div>
          <div class="col-md">una de dos</div>
        </div>
      </div>
    </div>
  );
};

export default Home;
